import React from 'react';
import { Link, useHistory } from 'react-router-dom';

const Team = (props) => {
const {strAlternate, strGender, idTeam} = props.team
const history =useHistory();
const handleClick = (teamId) =>{
    const url = `/team/${teamId}`;
    history.push(url);
}
const teamStyle={
    border:'1px solid purple',
    margin: '20px',
    padding: '20px',
    borderRadius: '20px'
}
return (
    <div style={teamStyle}>
    <h2>Name: {strAlternate}</h2>
    <p>Email: {strGender} </p>
    <p><small>ID: {idTeam}  <Link to={`/team/${idTeam}`}>click me</Link></small></p>   
    <button onClick={()=>handleClick(idTeam)}>show detail</button>
 </div>
    );
};

export default Team;
